    return (
        <div className='errorMessageContainer'>
            <h2 className='error-message'>What do you call 2000 mockingbirds? Two kilo mockingbird.</h2>
            <h2 className='error-message'>Sorry about that. We will have some shelf control as we get things back on track. Please try your request again</h2>
        </div>
    )
}
